pragma solidity ^0.8.6;

// SPDX-License-Identifier: MIT

import "./Post.sol";
import "./Profile.sol";
import "./Backend.sol";

interface IBackend {
    function count() external view returns (uint256);

    function fetchProfile(address _profileAddress) external returns (Profile);
}

// contract Counter {
